import React from 'react';
import { Grid } from '@material-ui/core';

const Profile = () => {
    return ( 
        <Grid container md={12}>

            <Grid item md={3}>
                Here is side bar
            </Grid>

            <Grid item md={6}>
                Center stuff 
            </Grid>

            <Grid item md={3}>
                Right side stuff
            </Grid>
        </Grid>
    );
}
 
export default Profile;
